import styled from 'styled-components';

const StyledContainer = styled.div`
    padding-right: 15px;
    padding-left: 15px;
    margin-right: auto;
    margin-left: auto;
    text-align : center;

    @media only screen and (min-width: 600px) {
        width: 90%;
    }
`

export default StyledContainer;
